import { Button } from "../../components/Button/Button";
import { Leaderboard } from "../../components/Leaderboard/Leaderboard";

export function LeaderboardPage() {
  return (
    <>
      <div className={styles.leaderboardContainer}>
        <h1>Лидерборд</h1>
        <Button>Начать игру</Button>
      </div>
      <Leaderboard />
    </>
  );
}
